6\u0435\u0442\u0435 \u043E\u0433\u0440\u0430\u043D\u0438\u0447\u0438\u0442\u044C \u043F\u043E\u0438\u0441\u043A, \u0443\u043A\u0430\u0437\u0430\u0432 \u0432 \u043A\u0430\u043A\u0438\u0445 \u0438\u043C\u0435\u043D\u043D\u043E \u0440\u0430\u0437\u0434\u0435\u043B\u0430\u0445 (\xAB\u0440\u0443\u0431\u0440\u0438\u043A\u0430\u0445\xBB) \u043A\u0430\u043A\u0438\u0445 \u0438\u043C\u0435\u043D\u043D\u043E \u0443\u0447\u0435\u0431\u043D\u0438\u043A\u043E\u0432, \u043F\u043B\u0430\u043D\u043E\u0432 \u043F\u043E\u0443\u0440\u043E\u0447\u043D\u043E\u0433\u043E \u043F\u043B\u0430\u043D\u0438\u0440\u043E\u0432\u0430\u043D\u0438\u044F, \u043A\u043E\u043B\u043B\u0435\u043A\u0446\u0438\u044F\u0445 (\xAB\u0440\u0443\u0431\u0440\u0438\u043A\u0430\u0442\u043E\u0440\u0430\u0445\xBB) \u0438\u0441\u043A\u0430\u0442\u044C \u0438\u043D\u0442\u0435\u0440\u0435\u0441\u0443\u044E\u0449\u0438\u0435 \u0432\u0430\u0441 \u0446\u0438\u0444\u0440\u043E\u0432\u044B\u0435 \u043E\u0431\u0440\u0430\u0437\u043E\u0432\u0430\u0442\u0435\u043B\u044C\u043D\u044B\u0435 \u0440\u0435\u0441\u0443\u0440\u0441\u044B.<\/li><\/ul><p style=margin-bottom:1.25ex;>\u0414\u043B\u044F \u043D\u0430\u0447\u0430\u043B\u0430 \u043F\u043E\u0438\u0441\u043A\u0430 \u043E\u0431\u044A\u0435\u043A\u0442\u043E\u0432 \u043F\u043E \u0437\u0430\u0434\u0430\u043D\u043D\u044B\u043C \u043F\u0430\u0440\u0430\u043C\u0435\u0442\u0440\u0430\u043C \u043D\u0443\u0436\u043D\u043E \u0449\u0435\u043B\u043A\u043D\u0443\u0442\u044C \u043C\u044B\u0448\u044C\u044E \u043D\u0430 \u043A\u043D\u043E\u043F\u043A\u0435 <b>\xAB\u0418\u0441\u043A\u0430\u0442\u044C\xBB<\/b>.<\/p><p style=margin-bottom:1.25ex;>\u0414\u043B\u044F \u0432\u043E\u0437\u0432\u0440\u0430\u0442\u0430 \u0432 \u0440\u0435\u0436\u0438\u043C \u043F\u0440\u043E\u0441\u0442\u043E\u0433\u043E \u043F\u043E\u0438\u0441\u043A\u0430 \u0434\u043E\u0441\u0442\u0430\u0442\u043E\u0447\u043D\u043E \u0449\u0435\u043B\u043A\u043D\u0443\u0442\u044C \u043C\u044B\u0448\u044C\u044E \u043D\u0430 \u0441\u044 37 \u043F\u0435\u0440\u0435\u0447\u0438\u0441\u043B\u0435\u043D\u043D\u044B\u0445 \u0432 \u0437\u0430\u043F\u0440\u043E\u0441\u0435 \u0441\u043B\u043E\u0432.<\/p><p style=margin-bottom:1.25ex;>\u0414\u043B\u044F \u043F\u043E\u0438\u0441\u043A\u0430 \u0441\u043B\u043E\u0432\u043E\u0441\u043E\u0447\u0435\u0442\u0430\u043D\u0438\u044F \u0438\u0441\u043F\u043E\u043B\u044C\u0437\u0443\u0439\u0442\u0435 <b>\u0434\u0432\u043E\u0439\u043D\u044B\u0435 \u043A\u0430\u0432\u044B\u0447\u043A\u0438<\/b>. \u041D\u0430\u043F\u0440\u0438\u043C\u0435\u0440, \u043F\u043E \u0437\u0430\u043F\u0440\u043E\u0441\u0443 <b>"\u044F\u0434\u0435\u0440\u043D\u0430\u044F \u0440\u0435\u0430\u043A\u0446\u0438\u044F"<\/b> \u0431\u0443\u0434\u0443\u0442 \u043D\u0430\u0439\u0434\u0435\u043D\u044B \u0442\u043E\u043B\u044C\u043A\u043E \u0442\u0435 \u0434\u043E\u043A\u0443\u043C\u0435\u043D\u0442\u044B, \u043A\u043E\u0442\u043E\u0440\u044B\u0435 \u0441\u043E\u0434\u0435\u0440\u0436\u0430\u0442 \u0437\u0430\u0434\u0430\u043D\u043D\u043E\u0435 \u0441\u043B\u043E\u0432\u043E\u0441\u043E\u0447\u0435\u0442\u0430\u043D\u0438\u0435 \u0446\u0435\u043B\u0438\u043A\u043E\u043C, \u0441 \u0443\u0447\u0435\u0442\u043E\u043C \u043C\u043E\u0440\u0444\u043E\u043B\u043E\u0433\u0438\u0438 \u0432\u0445\u043E\u0434\u044F\u0449\u0438\u0445 \u0432 \u043D\u0435\u0433\u043E \u0441\u043B\u043E\u0432 (<b>\u044F\u0434\u0435\u0440\u043D\u044B\u0435 \u0440\u0435\u0430\u043A\u0446\u0438\u0438<\/b>, <b>\u044F\u0434\u0435\u0440\u043D\u0443\u044E \u0440\u0435\u0430\u043A\u0446\u0438\u044E<\/b> \u0438 \u0442.\u0434.).<\/p><p style=margin-bottom:1.25ex;><b>\u0421\u0438\u043C\u0432\u043E\u043B<\/b> <b>*<\/b> \u0438\u0441\u043F\u043E\u043B\u044C\u0437\u0443\u0435\u0442\u0441\u044F \u0432 \u043A\u043E\u043D\u0446\u0435 \u0441\u043B\u043E\u0432\u0430 \u0434\u043B\u044F \u0443\u043A\u0430\u0437\u0430\u043D\u0438\u044F \u043B\u044E\u0431\u043E\u0433\u043E \u043E\u043A\u043E\u043D\u0447\u0430\u043D\u0438\u044F \u0434\u0430\u043D\u043D\u043E\u0433\u043E \u0441\u043B\u043E\u0432\u0430. \u041D\u0430\u043F\u0440\u0438\u043C\u0435\u0440, \u043F\u043E \u0437\u0430\u043F\u0440\u043E\u0441\u0443 <b>\u044F\u0434*<\/b> \u0431\u0443\u0434\u0443\u0442 \u043D\u0430\u0439\u0434\u0435\u043D\u044B \u0434\u043E\u043A\u0443\u043C\u0435\u043D\u0442\u044B, \u0441\u043E\u0434\u0435\u0440\u0436\u0430\u0449\u0438\u0435 \u0441\u043B\u043E\u0432\u0430 <b>\u044F\u0434\u0440\u043E<\/b>, <b>\u044F\u0434\u0435\u0440\u043D\u044B\u0439<\/b>, <b>\u044F\u0434\u043E\u0432\u0438\u0442\u044B\u0439<\/b> \u0438 \u0442.\u043F. \u041D\u0435\u0434\u043E\u043F\u0443\u0441\u0442\u0438\u043C\u043E \u0438\u0441\u043F\u043E\u043B\u044C\u0437\u043E\u0432\u0430\u043D\u0438\u0435 \u0441\u0438\u043C\u0432\u043E\u043B\u0430 <b>*<\/b> \u0432 \u043D\u0430\u0447\u0430\u043B\u0435 \u0441\u043B\u043E\u0432\u0430.<\/p><p style=margin-bottom:1.25ex;><b>\u0417\u043D\u0430\u043A<\/b> <b>+<\/b> \u043F\u0435\u0440\u0435\u0434 \u0441\u043B\u043E\u0432\u043E\u043C \u0443\u043A\u0430\u0437\u044B\u0432\u0430\u0435\u0442, \u0447\u0442\u043E \u044D\u0442\u043E \u0441\u043B\u043E\u0432\u043E \u043E\u0431\u044F\u0437\u0430\u0442\u0435\u043B\u044C\u043D\u043E \u0434\u043E\u043B\u0436\u043D\u043E \u043F\u0440\u0438\u0441\u0443\u0442\u0441\u0442\u0432\u043E\u0432\u0430\u0442\u044C \u0432 \u043D\u0430\u0439\u0434\u0435\u043D\u043D\u043E\u043C \u0434\u043E\u043A\u0443\u043C\u0435\u043D\u0442\u0435.<\/p><p style=margin-bottom:1.25ex;><b>\u0417\u043D\u0430\u043A<\/b> <b>-<\/b> \u043F\u0435\u0440\u0435\u0434 \u0441\u043B\u043E\u0432\u043E\u043C \u0438\u0441\u043A\u043B\u044E\u0447\u0430\u0435\u0442 \u0438\u0437 \u0440\u0435\u0437\u0443\u043B\u044C\u0442\u0430\u0442\u043E\u0432 \u0437\u0430\u043F\u0440\u043E\u0441\u0430 \u0434\u043E\u043A\u0443\u043C\u0435\u043D\u0442\u044B, \u0441\u043E\u0434\u0435\u0440\u0436\u0430\u0449\u0438\u0435 \u0434\u0430\u043D\u043D\u043E\u0435 \u0441\u043B\u043E\u0432\u043E.<\/p><p style=margin-bottom:1.25ex;><b>\u041E\u043F\u0435\u0440\u0430\u0442\u043E\u0440 AND<\/b> (\u0438\u043B\u0438 <b>&&<\/b>) \u0438\u0441\u043F\u043E\u043B\u044C\u0437\u0443\u0435\u0442\u0441\u044F \u0434\u043B\u044F \u043F\u043E\u0438\u0441\u043A\u0430 \u0434\u043E\u043A\u0443\u043C\u0435\u043D\u0442\u043E\u0432, \u0441\u043E\u0434\u0435\u0440\u0436\u0430\u0449\u0438\u0445 \u0432\u0441\u0435 \u0441\u0432\u044F\u0437\u0430\u043D\u043D\u044B\u0435 \u043E\u043F\u0435\u0440\u0430\u0442\u043E\u0440\u043E\u043C \u0441\u043B\u043E\u0432\u0430 \u0438\u043B\u0438 \u0444\u0440\u0430\u0437\u044B. \u041D\u0430\u043F\u0440\u0438\u043C\u0435\u0440, \u043F\u043E \u0437\u0430\u043F\u0440\u043E\u0441\u0443 <b>\u0444\u0438\u0437\u0438\u043A\u0430 AND \u043A\u0438\u043D\u0435\u043C\u0430\u0442\u0438\u043A\u0430 AND \u043E\u043A\u0435\u0430\u043D\u043E\u043B\u043E\u0433\u0438\u044F<\/b> \u043D\u0430\u0439\u0434\u0443\u0442\u0441\u044F \u0442\u043E\u043B\u044C\u043A\u043E \u0442\u0435 \u0434\u043E\u043A\u0443\u043C\u0435\u043D\u0442\u044B, \u0432 \u0442\u0435\u043A\u0441\u0442\u0435 \u043A\u043E\u0442\u043E\u0440\u044B\u0445 \u0441\u043E\u0434\u0435\u0440\u0436\u0430\u0442\u0441\u044F \u0432\u0441\u0435 \u0442\u0440\u0438 \u0441\u043B\u043E\u0432\u0430.<\/p><p style=margin-bottom:1.25ex;><b>\u041E\u043F\u0435\u0440\u0430\u0442\u043E\u0440 NOT<\/b> (\u0438\u043B\u0438 <b>!<\/b>) \u0438\u0441\u043F\u043E\u043B\u044C\u0437\u0443\u0435\u0442\u0441\u044F \u0434\u043B\u044F \u043F\u043E\u0438\u0441\u043A\u0430 \u0434\u043E\u043A\u0443\u043C\u0435\u043D\u0442\u043E\u0432, \u043D\u0435 \u0441\u043E\u0434\u0435\u0440\u0436\u0430\u0449\u0438\u0445 \u0441\u043B\u043E\u0432\u043E \u0438\u043B\u0438 \u0444\u0440\u0430\u0437\u0443, \u0443\u043A\u0430\u0437\u0430\u043D\u043D\u0443\u044E \u043F\u043E\u0441\u043B\u0435 \u043E\u043F\u0435\u0440\u0430\u0442\u043E\u0440\u0430.<\/p><p style=margin-bottom:1.25ex;><b>\u041E\u043F\u0435\u0440\u0430\u0442\u043E\u0440 OR<\/b> (\u0438\u043B\u0438 <b>||<\/b>) \u0430\u043D\u0430\u043B\u043E\u0433\u0438\u0447\u0435\u043D \u043F\u0440\u043E\u0431\u0435\u043B\u0443 \u043C\u0435\u0436\u0434\u0443 \u0441\u043B\u043E\u0432\u0430\u043C\u0438 \u0438 \u0438\u0441\u043F\u043E\u043B\u044C\u0437\u0443\u0435\u0442\u0441\u044F \u0434\u043B\u044F \u043F\u043E\u0438\u0441\u043A\u0430 \u0434\u043E\u043A\u0443\u043C\u0435\u043D\u0442\u043E\u0432, \u0441\u043E\u0434\u0435\u0440\u0436\u0430\u0449\u0438\u0445 \u0445\u043E\u0442\u044F \u0431\u044B \u043E\u0434\u043D\u043E \u0438\u0437 \u0440\u0430\u0437\u0434\u0435\u043B\u0435\u043D\u043D\u044B\u0445 \u043E\u043F\u0435\u0440\u0430\u0442\u043E\u0440\u043E\u043C \u0441\u043B\u043E\u0432.<\/p><p style=margin-bottom:1.25ex;>\u0414\u043B\u044F \u043F\u043E\u0441\u0442\u0440\u043E\u0435\u043D\u0438\u044F \u0431\u043E\u043B\u0435\u0435 \u0441\u043B\u043E\u0436\u043D\u044B\u0445 \u0437\u0430\u043F\u0440\u043E\u0441\u043E\u0432 \u0438\u0441\u043F\u043E\u043B\u044C\u0437\u0443\u0435\u0442\u0441\u044F <b>\u0433\u0440\u0443\u043F\u043F\u0438\u0440\u043E\u0432\u043A\u0430<\/b>: \u0437\u0430\u043F\u0440\u043E\u0441 <b>(\u0444\u0438\u0437\u0438\u043A\u0430 OR \u043A\u0438\u043D\u0435\u043C\u0430\u0442\u0438\u043A\u0430) AND \u0437\u0430\u043A\u043E\u043D\u044B<\/b> \u043D\u0430\u0439\u0434\u0435\u0442 \u0434\u043E\u043A\u0443\u043C\u0435\u043D\u0442\u044B, \u0432 \u043A\u043E\u0442\u043E\u0440\u044B\u0445 \u0441\u043E\u0434\u0435\u0440\u0436\u0438\u0442\u0441\u044F \u0445\u043E\u0442\u044F \u0431\u044B \u043E\u0434\u043D\u043E \u0438\u0437 \u0441\u043B\u043E\u0432 <b>\u0444\u0438\u0437\u0438\u043A\u0430<\/b> \u0438\u043B\u0438 <b>\u043A\u0438\u043D\u0435\u043C\u0430\u0442\u0438\u043A\u0430<\/b> \u0438 \u043E\u0431\u044F\u0437\u0430\u0442\u0435\u043B\u044C\u043D\u043E \u0441\u043B\u043E\u0432\u043E <b>\u0437\u0430\u043A\u043E\u043D\u044B<\/b>.<\/p>');Hu(b,'e4-panel-body');EN(c,b,new rhb(15));bN(a.d,false);DN(a.d,c);XM(a.d,false)}
